def wait_for_key_hotkey(button):
    button.config(text=" -- ")
    key = keyboard.read_event()
    if key.event_type == keyboard.KEY_DOWN:
        pressed_key = key.name
        button.config(text="Current key: " + pressed_key)
        try:
            keyboard.remove_hotkey(spawn)
        except Exception:
            pass
        keyboard.add_hotkey(pressed_key, spawn)
mouse = pynput.mouse.Controller()
def spawn():
    # keyboard.press_and_release("f1")
    # time.sleep(0.1)
    keyboard.press("tab")
    keyboard.release("tab")
    time.sleep(0.07)
    keyboard.write(item.get())
    time.sleep(0.07)
    mouse.click(pynput.mouse.Button.left, 1)
    time.sleep(0.07)
    keyboard.press("enter")
    time.sleep(0.02)
    keyboard.release("enter")
